import { Component } from "react";

export class userProfile extends Component {
  constructor(props) {
    super(props);

    this.refreshlist = this.refreshlist.bind(this);

    this.state = {
      userData: [],
      agmUnit: "",
      dgmUnit: "",
      serviceUnit: "",
      username: "",
    };
  }

  componentDidMount() {
    this.refreshlist();
  }

  refreshlist() {}

  render() {
    const { userData, agmUnit, dgmUnit, serviceUnit, username } = this.state;

    return (
      <div className="dropdown">
        <button
          className="btn btn-info dropdown-toggle"
          type="button"
          data-bs-toggle="dropdown"
          aria-expanded="false"
        >
          Dropdown button
        </button>

        <ul className="dropdown-menu">
          <li>
            <a className="dropdown-item" href="#">
              Action
            </a>
          </li>

          <li>
            <a className="dropdown-item" href="#">
              Another action
            </a>
          </li>

          <li>
            <a className="dropdown-item" href="#">
              Something else here
            </a>
          </li>
        </ul>
      </div>
    );
  }
}
